// src/pages/Home.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './Home.css';
import Features from './Features';


function Home() {
  const navigate = useNavigate();

//   const handleCreatePlan = () => {
//     navigate('/plan-choice'); // 之后我们创建这个路由
//   };

  return (
    <>
    <div className="home-container">
      <nav className="navbar">
        <div className="logo">GoGoGlobe</div>
        <div className="nav-links">
          <a href="/plans">My Plan</a>
          <a href="/login">Sign Out</a>
        </div>
      </nav>

      <div className="main-content">
        <div className="left-panel">
        <div className="text-wrapper">
          <h1>Tired of chaotic travel planning?</h1>
          <h2><span className="highlight">Plan together.</span> Remember forever.</h2>
          <button className="primary-btn" onClick={() => navigate('/create')}>
            Start a New Plan
          </button>
          <button className="secondary-btn" onClick={() => navigate('/plans')}>
            View Existing Plans
          </button>

        </div>
        </div>
        </div>
      </div>
    <Features />
    </>
  );
}

export default Home;
